import axios from 'axios';
import logo from './logo.svg';
import './App.css';
import Axios from 'axios';

function App() {
  const [todos, settodos] = useState('')
  useEffect( () => {
    axios.get('https:127.0.0.1:8000/todos')
      .then(res => {
        console.log(res)
        settodos(res.data)
      })
      .catch(err => {
        console.log(err)
      },[])

  })
  return (
    <div className="App">
        {

        }
    </div>
  );
}

export default App;
